    // Decode a base64 data URI into an AudioBuffer
    function decodeB64Audio(dataUri) {
      if (!_audioCtx || !dataUri) return Promise.resolve(null);
      try {
        var b64 = dataUri.split(',')[1];
        var raw = atob(b64);
        var buf = new ArrayBuffer(raw.length);
        var arr = new Uint8Array(buf);
        for (var i = 0; i < raw.length; i++) arr[i] = raw.charCodeAt(i);
        return _audioCtx.decodeAudioData(buf).catch(function () { return null; });
      } catch(e) { return Promise.resolve(null); }
    }

    // Audio buffers (filled after decode)
