    function markFirstInteraction() {
      if (adFirstInteraction) return;
      adFirstInteraction = true;
      adTimerStartMs = performance.now();
      window.__adTimerStarted = true;
      ctaRevealTimeoutId = setTimeout(showInstallCta, CTA_SHOW_DELAY_MS);
      if (_audioCtx && _audioCtx.state !== 'running') {
        // Mobile: resume() is async and may need a second gesture to resolve on
        // some browsers. Poll via rAF so updateAudio() fires the frame state
        // becomes 'running', independent of when the Promise resolves.
        _audioCtx.resume().catch(function () {});
        requestAnimationFrame(function waitForRunning() {
          if (_audioCtx.state === 'running') { updateAudio(); }
          else { requestAnimationFrame(waitForRunning); }
        });
      } else {
        updateAudio();
      }
    }

    function getAdElapsedMs() {
      return adTimerStartMs === null ? 0 : Math.max(0, performance.now() - adTimerStartMs);
    }
    window.getAdElapsedMs = getAdElapsedMs;

    function whenMraidReady(callback) {
      const mraidApi = window.mraid;
      if (typeof callback !== 'function') return;
      if (!mraidApi) return; // MRAID not available  do not start

      let finished = false;
      const finish = function () {
        if (finished) return;
        finished = true;
        clearTimeout(timeoutId);
        if (typeof mraidApi.removeEventListener === 'function') {
          mraidApi.removeEventListener('ready', onReady);
          mraidApi.removeEventListener('stateChange', onStateChange);
        }
        callback();
      };

      const onReady = finish;

      const onStateChange = function (state) {
        if (state && state !== 'loading') finish();
      };

      const timeoutId = setTimeout(function () {
        var state = typeof mraidApi.getState === 'function' ? mraidApi.getState() : 'loading';
        if (state !== 'loading') finish();
      }, 1200);
      const mraidState = typeof mraidApi.getState === 'function' ? mraidApi.getState() : 'default';
      if (mraidState !== 'loading') {
        finish();
        return;
      }

      if (typeof mraidApi.addEventListener === 'function') {
        mraidApi.addEventListener('ready', onReady);
        mraidApi.addEventListener('stateChange', onStateChange);
      } else {
        finish();
      }
    }

