    // #region [UTILS_GLTF]
    function parseGLB(buffer) {
      const view = new DataView(buffer);
      const jsonLen = view.getUint32(12, true);
      const jsonStr = new TextDecoder().decode(new Uint8Array(buffer, 20, jsonLen));
      const gltf = JSON.parse(jsonStr);
      const binOffset = 20 + jsonLen + 8; 
      const binData = buffer.slice(binOffset);

      const TYPE_SIZES = { SCALAR: 1, VEC2: 2, VEC3: 3, VEC4: 4 };
      const COMP_ARRAYS = { 5120: Int8Array, 5121: Uint8Array, 5122: Int16Array, 5123: Uint16Array, 5125: Uint32Array, 5126: Float32Array };

      function getAccessorData(accIdx) {
        const acc = gltf.accessors[accIdx];
        const bv = gltf.bufferViews[acc.bufferView];
        const offset = (bv.byteOffset || 0) + (acc.byteOffset || 0);
        const ArrType = COMP_ARRAYS[acc.componentType];
        const count = acc.count * TYPE_SIZES[acc.type];
        if (offset % ArrType.BYTES_PER_ELEMENT !== 0) {
          const bytes = count * ArrType.BYTES_PER_ELEMENT;
          const copy = new Uint8Array(bytes);
          copy.set(new Uint8Array(binData, offset, bytes));
          return new ArrType(copy.buffer, 0, count);
        }
        return new ArrType(binData, offset, count);
      }

      return { gltf: gltf, binData: binData, getAccessorData: getAccessorData };
    }

    function extractMesh(parsed, meshIndex) {
      var gltf = parsed.gltf, getAccessorData = parsed.getAccessorData;
      var mi = meshIndex || 0;
      var prim = gltf.meshes[mi].primitives[0];
      var geo = new THREE.BufferGeometry();
      if (prim.attributes.POSITION !== undefined) geo.setAttribute('position', new THREE.BufferAttribute(getAccessorData(prim.attributes.POSITION), 3));
      if (prim.attributes.NORMAL !== undefined) geo.setAttribute('normal', new THREE.BufferAttribute(getAccessorData(prim.attributes.NORMAL), 3));
      if (prim.attributes.TEXCOORD_0 !== undefined) geo.setAttribute('uv', new THREE.BufferAttribute(getAccessorData(prim.attributes.TEXCOORD_0), 2));
      if (prim.indices !== undefined) geo.setIndex(new THREE.BufferAttribute(getAccessorData(prim.indices), 1));

      // Apply node matrix if present
      var meshNode = gltf.nodes.find(function (n) { return n.mesh === mi; });
      if (meshNode && meshNode.matrix) {
        var m = new THREE.Matrix4().fromArray(meshNode.matrix);
        geo.applyMatrix4(m);
      }

      return geo;
    }

    function loadGLBFromBase64(b64DataUrl, meshIndex) {
      const b64 = b64DataUrl.includes(',') ? b64DataUrl.split(',')[1] : b64DataUrl;
      const raw = atob(b64);
      const buffer = new ArrayBuffer(raw.length);
      const arr = new Uint8Array(buffer);
      for (let i = 0; i < raw.length; i++) arr[i] = raw.charCodeAt(i);
      const parsed = parseGLB(buffer);
      return extractMesh(parsed, meshIndex || 0);
    }

